// ================================== Script Start =====================================
(function($) {
    var allfunction = {

        //============== Menu Icon ============== 
        menu_icon: function() {
            $('.main-menu ul li').each(function() {
                if ($(this).children('.sub-menu,.mega-menu').length) {
                    $(this).children('a')
                    .append(`<svg width="11" height="7" viewBox="0 0 11 7" fill="none" xmlns="http://www.w3.org/2000/svg"><path fill-rule="evenodd" clip-rule="evenodd" d="M0.792893 0.792893C1.18342 0.402369 1.81658 0.402369 2.2071 0.792893L5.49999 4.08579L8.79288 0.792893C9.1834 0.402369 9.81657 0.402369 10.2071 0.792893C10.5976 1.18342 10.5976 1.81658 10.2071 2.20711L6.2071 6.20711C5.81657 6.59763 5.18341 6.59763 4.79289 6.20711L0.792893 2.20711C0.402369 1.81658 0.402369 1.18342 0.792893 0.792893Z" fill="#8b9097"/></svg>
                    `);
                }
            });
        },

        //=============== Menu ==============
        menu_toggle: function() {
            $('.hamgurger').on("click", function(e) {
                e.stopPropagation()
                $(this).toggleClass('active');
                $('.main-menu').toggleClass('active');
                if ($(".main-menu").hasClass('active')) {
                    $("body").addClass('overlay');
                } else {
                    $("body").removeClass('overlay');
                    $('.sub-menu').slideUp().parents('li').removeClass('active');
                }
            });
            $('.main-menu ul li').on('click', function(e) {
                e.stopPropagation();
                $(this).children('.sub-menu,.mega-menu').slideToggle(200).parents('li').siblings().find('.sub-menu,.mega-menu').slideUp(200);
                $(this).toggleClass('active').siblings().removeClass('active').find('.sub-menu,.mega-menu').slideUp(200);
            });
            
            $('a[href=#]').on('click', function(e) {
                e.preventDefault(); 
            });
        },


        nav_tabs: function() {
            $("#stories-nav-tabs a").on('click', function(e) {
                e.preventDefault();
                var id = $(this).attr('href').split('#')[1];
                var tabContent = $('.stories-card-wrapper')
                $(this).parent().addClass('active').siblings().removeClass('active');
                tabContent.each(function() {
                    if ($(this).attr('id') == id) {
                        $(this).addClass('active').siblings().removeClass('active');
                    }
                })
            });
        },


        // Load More Function
        loadmore: () => {
            // Load more posts JS
                var nextPage = $('link[rel=next]').attr('href'),
                a = $('.show-more'),
                b = $('.show-more-box')

            if (!nextPage) {
                b.remove();
            }
            a.click(function(n) {
                n.preventDefault()
                var i =
                    nextPage.split(/page/)[0] +
                    'page/' +
                    pagination_next_page_number +
                    '/'
                $.ajax({
                    url: i,
                    beforeSend: function() {
                        a.html(
                            '<svg version="1.1" id="loader-1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" width="30px" height="30px" viewBox="0 0 40 40" enable-background="new 0 0 40 40" xml:space="preserve"><path opacity="0.2" fill="#233558" d="M20.201,5.169c-8.254,0-14.946,6.692-14.946,14.946c0,8.255,6.692,14.946,14.946,14.946s14.946-6.691,14.946-14.946C35.146,11.861,28.455,5.169,20.201,5.169z M20.201,31.749c-6.425,0-11.634-5.208-11.634-11.634c0-6.425,5.209-11.634,11.634-11.634c6.425,0,11.633,5.209,11.633,11.634C31.834,26.541,26.626,31.749,20.201,31.749z" /><path fill="#000" d="M26.013,10.047l1.654-2.866c-2.198-1.272-4.743-2.012-7.466-2.012h0v3.312h0C22.32,8.481,24.301,9.057,26.013,10.047z"><animateTransform attributeType="xml" attributeName="transform" type="rotate" from="0 20 20" to="360 20 20" dur="0.5s" repeatCount="indefinite"/></path></svg>'
                        )
                    },
                }).done(function(data) {
                    var posts = $('.js-post-card', data),
                        postwrapper = $('.js-post-wrapper')
                    postwrapper.append(posts)
                    a.text('Load more')
                    pagination_next_page_number++
                    pagination_next_page_number >
                        pagination_available_pages_number &&
                        b.remove();
                })
            })
        },

       
        //================ copyCode js ==================
        copyCode: () => {
            $(document).click(function() {
                $(".copy-link").on("click", function (e) {
                    e.preventDefault();
                    var url = $(this).data("link");
            
                    var $temp = $("<input>");
                    $("body").append($temp);
                    $temp.val(url).select();
                    document.execCommand("copy");
                    $temp.remove();
                    $(".copied").fadeIn();
            
                    setTimeout(function () {
                        $(".copied").fadeOut();
                    }, 1000);
                }); 
            })
        },

       
        
        //================== StopPropagations elements =================
        stopPropagationElements: () => {
            $('.main-menu,.language-list,.language-empty,.copyCode').click(function(e) {
                e.stopPropagation()
            })
        },

        postContectImageGallery: () => {
            $('.post-content .kg-card img').each(function() {
                var contentImageSrc = $(this).attr('src');
                $(this).wrap('<a class="image-popup-class" href=' + contentImageSrc + '></a>')
            });

            $('.zoom-gallery').magnificPopup({
                delegate: '.image-popup-class',
                type: 'image',
                closeOnContentClick: false,
                closeBtnInside: false,
                mainClass: 'mfp-with-zoom mfp-img-mobile',
                image: {
                    verticalFit: true,
                    titleSrc: function(item) {
                        return item.el.attr('title') + ' &middot; <a class="image-source-link" href="'+item.el.attr('data-source')+'" target="_blank">image source</a>';
                    }
                },
                gallery: {
                    enabled: true
                },
                zoom: {
                    enabled: true,
                    duration: 300, // don't foget to change the duration also in CSS
                    opener: function(element) {
                        return element.find('img');
                    }
                }
                
            });
        },

        // Footer Menu 
        footer_menu: () => {
            if ($(window).width() < 767) {
                $('.signle_footer_item_button').on('click', function() {
                    $(this).toggleClass('active').siblings().slideToggle();
                })
            }
        },

        // Toc Menu 
        toc_menu: () => {
            $('.toc-button').on('click', function() {
                $(this).toggleClass('active').siblings().slideToggle();
            })
        },

        sticky_menu: function() {
            let win = $(window);
            let sticky_id = $(".header-area");
            win.on('scroll', function () {
                let scroll = win.scrollTop();
                if (scroll <= 2) {
                    sticky_id.removeClass("sticky-header");
                } else {
                    sticky_id.addClass("sticky-header");
                }
            });
        },

        btnHideShow: function() {
            $(window).scroll(function () {
                if ($(this).scrollTop() !== 0) {
                    $('#btnHideShow').fadeIn(500);
                } else {
                    $('#btnHideShow').fadeOut(500);
                }
            });
        },
    
        authorShow:function(){
            $('.click-author-title').on('click',function(){
                $(this).toggleClass('active').parents('.author-card').children().children('.show-author-bio').slideToggle(300);
            })
        },
        //================ Document click to hide elements ==================
        elementHide: () => {
            $(document).click(function() {
                $('.hamgurger,.main-menu').removeClass('active');
                $('.sub-menu,.mega-menu').hide(100).parents('li').removeClass('active');
                $('.overlay').removeClass('overlay');
            })
        },
     

        swiper_slider: () => {
            var swiper = new Swiper(".hero_slider", {
                spaceBetween: 24,
                pagination: {
                    el: ".hero_slider_pagination",
                    clickable: true,
                },
                breakpoints: {
                    576: {
                        spaceBetween: 30,
                    },
                }
            });

            // video hub slider
            var swiper = new Swiper(".video-hub-slider", {
                spaceBetween: 24,
                pagination: {
                    el: ".video-hub_pagination",
                    clickable: true,
                },
                navigation: {
                    nextEl: ".video-hub-next",
                    prevEl: ".video-hub-prev",
                },
                breakpoints: {
                    0: {
                      slidesPerView: 1,
                    },
                    767: {
                      slidesPerView: 2,
                    },
                    992: {
                      slidesPerView: 3,
                    },
                  }
            });

            // Anaylisis
            var swiper = new Swiper(".anaylisis-slider", {
                spaceBetween: 24,
               autoHeight: true,
                pagination: {
                    el: ".anaylisis-slider_pagination",
                    clickable: true,
                },
            });
        },
        search: () => {
            // Search results
                var posts = [],
                searchKey = $(".search-input"),
                searchContent = $('.search-full-content'),
                searchResultWrap = $('.search-result'),
                searchBar = $('.search-input-bar')

            if (posts.length == 0 && typeof serachContentApi !== undefined) {
                $.get(serachContentApi)
                    .done(function(data) {
                        posts = data.posts
                        search()
                    })
                    .fail(function(err) {
                        console.log('failed')
                    })
            }


            $('.icon_close').on('click', function () {
                searchRemover()
            });
            $(document).on('click', function () {
                searchRemover()
            });
            function searchRemover(){
                searchResultWrap.removeClass('active')
                searchKey.val('')
                searchContent.empty()
            }

            function search(){
                var options = {
                    shouldSort: true,
                    tokenize: true,
                    matchAllTokens: true,
                    threshold: 0,
                    location: 0,
                    distance: 100,
                    maxPatternLength: 32,
                    minMatchCharLength: 1,
                    keys: [{
                    name: 'title',
                    weight: 0.3
                    }, {
                    name: 'plaintext',
                    weight: 0.7
                    }]
                };
                var fuse = new Fuse(posts, options)
                
                searchKey.on('keyup', function(){
                    searchBar.addClass('loading')
                    var value = this.value,
                    search = fuse.search(value),
                    output = '',
                    searchResultnum = $('.no-result')
                    searchResultWrap.addClass('active')
                    searchResultnum.addClass('d-block')
                    searchResultnum.children('span').html(search.length)
                    if(posts.length > 0 && value.length > 0){
                    $.each(search, function(key, val) {
                    
                            output += `
                            <a class="single-search-result" href="${val.url}">
                                <div class="single-result-item">
                                    <div class="result-title d-flex align-items-center">
                                    ${(val.tags[0])?`<span class="p-tag text-xs leading-[18px] font-semibold py-1 px-3 bg-[#F8F8F8] rounded-[32px] text-pragrapgh inline-block">${val.tags[0].name}</span>`:""}
                                        <h5 class="post-title">${val.title}
                                        </h5>
                                    </div>
                                    <p class="post-text line-clamp-3 mt-2 text-sm leading-[22px] tracking-[-0.01px] text-[#777C85]">${val.excerpt}</p>
                                </div>
                            </a>
                            `
                        })

                        searchContent.html(output)
                        searchBar.removeClass('loading')
                    }
                    if(value.length === 0){
                        searchResultWrap.removeClass('active');
                        searchBar.removeClass('loading');
                    }


                })
            } 

        },
        init: function() {
            allfunction.menu_icon()
            allfunction.menu_toggle()
            allfunction.sticky_menu()
            allfunction.loadmore()
            allfunction.stopPropagationElements()
            allfunction.elementHide()
            allfunction.copyCode()
            allfunction.postContectImageGallery()
            allfunction.footer_menu()
            allfunction.toc_menu()
            allfunction.btnHideShow()
            allfunction.authorShow()
            allfunction.search()
            allfunction.swiper_slider()
        },
    }

    $(document).ready(function() {
        allfunction.init();
        window.addEventListener('load',function(){
            document.querySelector('body').classList.add("loaded")  
        });
    });

    $('.language-wrap').on('click', function(e){
        e.stopPropagation()
        $(this).toggleClass('active');
        $('.language-selector').toggle();
    });

    $(document).on('click', function(){
        $('.language-selector').hide();
        $('.language-wrap').removeClass('active');
    });
    $('table').addClass('table').wrap('<div class="table-responsive"></div>')
    $('.click-category').on('click', function(e){
        e.stopPropagation()
        $(this).toggleClass('active');
        $(this).next().slideToggle();
    })
    $(document).on('click', function(){
        $('.click-category').removeClass('active');
        $('.category__item').slideUp();
    });
})(jQuery);



window.addEventListener('DOMContentLoaded', (event) => {
    const presomConst = document.querySelectorAll('pre[class*=language-]')
    if(presomConst.length <= 0) return;
    presomConst.forEach(function (node) {
        node.classList.add('line-numbers');
    });
    Prism.highlightAll();
});